One.onLoad(class {
    static initValidation() {
        One.helpers("jq-validation"), jQuery(".kullanici-ekle").validate({
            rules: {
                "kullanici_adi": {
                    required: !0,
                    minlength: 4
                },
                "sifre": {
                    required: !0,
                    minlength: 8
                }
            },
            messages: {
                "kullanici_adi": {
                    required: "Oluşturmak istediğin kullanıcı adını belirt.",
                    minlength: "Yeni kullanıcı adınız en az 4 karakter olmak zorundadır."
                },
                "sifre": {
                    required: "Oluşturmak istediğin yeni şifreyi belirt.",
                    minlength: "Yeni şifreniz en az 8 karakter olmak zorundadır."
                }
            }
        })
    }
    static init() {
        this.initValidation()
    }
}.init());